import React, { Component } from "react";
import PT from "prop-types";

export default class DefaultProps extends Component {
  static defaultProps = {
    name: "marx",
    age: 22
  };

  static propTypes = {
    num: PT.number
  };

  render() {
    console.log(this.props)
    return <div>{this.props.num}</div>;
  }
}
